import React from "react";
import { NavLink } from "react-router-dom";

function SideBar(){

  const menus = [
    {name : "머니 충전", path: "/main"},
    {name : "머니 결제", path: "/main/payCash"},
    {name : "거래내역", path: "/main/payHistory"},
  ]
    return(
    <aside>
      <div>
        <NavLink
        style={{color:"black",  textDecoration: "none"}}
        activestyle={{color:"#eb5149"}}
        to="/main">
          머니 충전
        </NavLink>
      <div>
        <NavLink to="/main/payCash">
          머니 결제
        </NavLink>
      </div>
      <div>
        <NavLink to="/main/payHistory">
          거래내역
        </NavLink>
      </div>
      </div>
    </aside>
    )
}

export default SideBar;
